widgets.props:
JS{{
  var props = {}
  var index = $ + 1
  props.address = "/adm/obj/" + index + "/name"
  props.id = "objName_" + index
  props.onValue = `
  var values = get(\"variable_srcList\");
  values[getIndex()] = value;
  set(\"variable_srcList\", values);
  `
  return props
}}

