//by Nicolas Erard

var dropdown_menu = {};


for(var key in value){
    if (value.hasOwnProperty(key) && value[key] != 'none')
    {
        dropdown_menu[value[key]] = Number(key)+1 ;
        //var value=obj[key];
        // work with key and value
    }
}

